import React from "react";

const FormInput = ({ handleChange, label, ...otherinputprops }) => {
  return (
    <div classname="group">
      <input
        className="form-input"
        onChange={handleChange}
        {...otherinputprops}
      />
      {label ? (
        <label
          classname={`(${this.props.value} ? 'shrink' : "") 'form-input-label'`}
        ></label>
      ) : null}
    </div>
  );
};

export default FormInput;
